import Header from "../components/header/Header";
import Footer from "../components/footer/Footer";
import Home from "../languages/src/home";

import CppContent from "../languages/src/cpp"
import JsContent from "../languages/src/js";
import PyContent from "../languages/src/py";
import HTMLContent from "../languages/src/html";
import TsContent from "../languages/src/ts";
import JavaContent from "../languages/src/java";


function HOME() {
    return (
       <div>
           <Header/>
           <Home/>
           <Footer/>
       </div>
    );
}

function HTML() {
    return (
       <div>
           <Header/>
           <HTMLContent/>
           <Footer/>
       </div>
    );
}

function CPP() {
    return (
       <div>
           <Header/>
           <CppContent/>
           <Footer/>
       </div>
    );
}

function PYTHON() {
    return (
       <div>
           <Header/>
           <PyContent/>
           <Footer/>
       </div>
    );
}

function JAVA() {
    return (
       <div>
           <Header/>
           <JavaContent/>
           <Footer/>
       </div>
    );
}

function JS() {
    return (
       <div>
           <Header/>
           <JsContent/>
           <Footer/>
       </div>
    );
}

function TS() {
    return (
       <div>
           <Header/>
           <TsContent/>
           <Footer/>
       </div>
    );
}

export {HOME, HTML, CPP, PYTHON, JS, TS};
